const Header = () => {
  return (
    <div>
      <div class="container">
        <header class="header">
          <img src="img/logo.png" alt="Honor logo" class="logo" />;
          <nav class="user-nav">
            <div class="user-nav__icon-box"></div>
            <div class="user-nav__icon-box"></div>
            <div class="user-nav__user">
              <img
                src="img/user.jpg"
                alt="User photo"
                class="user-nav__user-photo"
              />
              <span class="user-nav__user-name">Peter</span>
            </div>
          </nav>
        </header>
      </div>
    </div>
  );
};

export default Header;
